import { useEffect, useState } from "react";
import React from "react";

export default function Exchange() {
  const [ setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/exchange")
      .then((res) => res.json())
      .then((response) => {
        // Extract data from response: hits.hits, including _id
        const extractedData =
          response.hits?.hits?.map((item) => ({
            id: item._id, // Add _id
            ...item._source,
          })) || [];
        console.log("BÃ¶rsen-Daten.:", extractedData);
        setData(extractedData);
        setFilteredData(extractedData);
      })
      .catch((err) => console.error("Fehler beim Abrufen der Daten.:", err));
  }, []);

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold text-blue-600 mb-6">BÃ¶rsen-Daten</h1>

      {/* Table */}
      <div className="overflow-x-auto">
        <table className="table-auto w-full bg-white shadow-md rounded-lg">
          <thead>
            <tr className="bg-blue-500 text-black">
              <th className="px-4 py-2">ID</th>
              <th className="px-4 py-2">Symbol</th>
              <th className="px-4 py-2">Name</th>
              <th className="px-4 py-2">Typ</th>
              <th className="px-4 py-2">WÃ¤hrung</th>
              <th className="px-4 py-2">Land</th>
            </tr>
          </thead>
          <tbody>
            {filteredData.map((item, index) => (
              <tr key={index} className="border-b hover:bg-blue-100">
                <td className="px-4 py-2">{item.id || "N/A"}</td>
                <td className="px-4 py-2">{item.symbol || "N/A"}</td>
                <td className="px-4 py-2">{item.name || "N/A"}</td>
                <td className="px-4 py-2">{item.type || "N/A"}</td>
                <td className="px-4 py-2">{item.currency || "N/A"}</td>
                <td className="px-4 py-2">{item.country || "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
